class CarouselItem extends React.Component {


    render(){
        return  (
          <div className={ "carousel-item " + ( this.props.styleName || "") }>
            <a
              href={this.props.url}>
              <img
                  src={this.props.image}
                  className="d-block w-100"
                  alt="..." />
              <h5>{this.props.title}</h5>
            </a>
          </div>

        );
    }
}

export default CarouselItem;
